"use strict"

var vsSource = function( mIs2D )
{
  var str = "" +

  "#ifdef GL_ES\n" +
  "precision highp float;\n" +
  "#endif\n"+

  "uniform mat4 unMMod;"+
  "uniform mat4 unMPrj;"+
  "uniform mat4 unSMod;"+
  "uniform mat4 unSPrj;"+
  "uniform vec3 unCamPos;"+
  "uniform vec3 unLight;";

  if( mIs2D )
  {
  str += ""+
  "layout(location=0) in vec3 iPosition;"+
  "layout(location=1) in vec3 iNormal;"+
  "layout(location=2) in vec2 iUV;"+
  "out vec3 vfNor;"+
  "out vec2 vfUV;"+
  "out vec3 vfSPos;"+
  "out vec3 vfRd;";
  }
  else
  {
  str += ""+
  "attribute vec3 iPosition;"+
  "attribute vec3 iNormal;"+
  "attribute vec2 iUV;"+
  "varying vec3 vfNor;"+
  "varying vec2 vfUV;"+
  "varying vec3 vfSPos;"+
  "varying vec3 vfRd;";
  }

  str += ""+
  "void main()"+
  "{"+
      "vec3 wPos = iPosition;"+
      "vec4 ePos = unMMod * vec4(wPos,1.0);"+
      "vec4 sPos = unSPrj * unSMod * vec4(iPosition,1.0);"+
      "vfNor = iNormal;"+
      "vfUV = iUV;"+
      "vfSPos = sPos.xyz;"+
      "vfRd = wPos - unCamPos;"+
      "vec4 cPos = unMPrj * ePos;"+
      "gl_Position = cPos;"+
  "}";

  return str;
}
  

var fsSource = function( mIs2D )
{
  var str = "" +

  "#ifdef GL_ES\n"+
  "precision highp float;\n"+
  "#endif\n"+

  "uniform vec2  unKernel[32];"+
  "uniform float unTime;"+
  "uniform sampler2D unTexture0;"+
  "uniform sampler2D unTexture1;"+
  "uniform vec3 unLight;";

  if( mIs2D) 
  {
  str += ""+
  "in vec3 vfNor;"+
  "in vec2 vfUV;"+
  "in vec3 vfSPos;"+
  "in vec3 vfRd;"+
  "out vec4 outColor;";
  }
  else
  {
  str += ""+
  "varying vec3 vfNor;"+
  "varying vec2 vfUV;"+
  "varying vec3 vfSPos;"+
  "varying vec3 vfRd;";
  }

  str += ""+
  "float doShadow( in vec3 p )"+
  "{"+
      "float sh = 0.0;"+
      "for( int i=0; i<32; i++ )"+
      "{"+
      "vec2 off = 0.002*unKernel[i];"+
      "float sz = -1.0+2.0*texture( unTexture1, 0.5+0.5*p.xy+off ).x;"+
      "sh += step( p.z-sz, 0.0001 );"+
      "}"+
      "return sh/32.0;"+
  "}\n"+

  "void main()"+
  "{"+
      "vec3 nor = normalize( vfNor );"+
      "vec3 rd = normalize( vfRd );"+
      "vec3 col = vec3(0.2,0.2,0.2);"+
      "col = 0.4*texture( unTexture0, vfUV).xyz;"+

      "float sh = doShadow( vfSPos );"+

      "float dif = clamp( dot(nor,unLight), 0.0, 1.0 ) * sh;"+
      "float amb = 0.5 + 0.5*nor.y;"+
      "float bou = clamp( -nor.y, 0.0, 1.0 );"+
      "float fre = pow( clamp(1.0+dot(nor,rd),0.0,1.0), 3.0 );"+
      "vec3 lin  = 5.0*vec3(1.00,0.8,0.6) * dif;"+
           "lin += 1.0*vec3(0.05,0.2,0.4) * amb;"+
           "lin += 1.0*vec3(0.2,0.2,0.2) * bou;"+
           "lin += 0.6*vec3(1.0,0.9,0.7)*fre * (0.5+0.5*dif*fre);"+
      "col = col * lin;"+

      "col = sqrt(col);";

       str += mIs2D ? "outColor " : "gl_FragColor";
       str += " = vec4(col,1.0);"+
  "}";

  return str;
}


